import config from 'config';
import {postRequest, postRequest_v2} from "../utils/ajax";
import {history} from '../utils/history';
import {message} from 'antd';

export const login = (data) => {
    const url = "http://localhost:9000/user-service/login";
    console.log(url);
    const get = {credentials: data.username,client_id:"issuesApp",client_secret:"sjtu",password:data.password,grant_type:"password"};
    postRequest_v2(url, get);

};
